class phoneArea:
    @staticmethod
    def getPhoneAreaWithJsonNew(phone, dataJson):
        """ 优先按照最长的匹配"""
        r = {}
        try:
            root = dataJson["root"]
            countryRe = re.search(root["re"], phone)
            if countryRe is None:
                return r

            countryCode = countryRe.group(0)
            country_name = root[countryCode]
            r['code'] = countryCode
            r['country'] = country_name

            if countryCode == '852':
                r = {"country": "中国", "province": "香港"}
            elif countryCode == '886':
                r = {"country": "中国", "province": "台湾"}
            elif countryCode == '853':
                r = {"country": "中国", "province": "澳门"}
            elif countryCode == '86':
                phoneArea = Phone()
                p = phone[2:9]
                if len(p) < 7:
                    return r
                r2 = phoneArea.find(p)
                if r2:
                    if 'province' in r2:
                        r['province'] = r2['province']
                    if 'city' in r2:
                        r['city'] = r2['city']
            else:
                areaRoot = dataJson.get(countryCode, None)
                if areaRoot is None:
                    return r

                areaRe = re.search(areaRoot["re"], phone)
                if areaRe is None:
                    return r
                areaCode = areaRe.group(1)

                province, city = areaRoot[areaCode]
                if province is not None:
                    r['province'] = province
                if city is not None:
                    r['city'] = city

        except Exception as e:
            traceback.print_exc()
        finally:
            return r


